import React, { Component } from 'react'
import styled from 'styled-components'

// Components
import FullScreen from '../fullscreen'
import Title from '../title'

// Images
import background from './background.jpg'

const ProfileWrapper = styled(FullScreen)`
  background: linear-gradient(rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.7)),
    url(${background});
  background-size: cover;
  color: white;
  width: 70%;
  display: inline-block;
  vertical-align: top;
`

const ProfileContainer = styled.div`
  width: intrinsic;
  padding: 30px 50px;
  position: relative;
`
const ProfileBorder = styled.div`
  &:before {
    content: '';
    position: absolute;
    width: 70%;
    height: 60%;
    bottom: 0;
    left: 0;
    border-bottom: 1px solid rgba(255, 255, 255, 0.6);
    border-left: 1px solid rgba(255, 255, 255, 0.6);
  }

  &:after {
    content: '';
    position: absolute;
    width: 70%;
    height: 60%;
    top: 0;
    right: 0;
    border-top: 1px solid rgba(255, 255, 255, 0.6);
    border-right: 1px solid rgba(255, 255, 255, 0.6);
  }
`

const ProfileTitle = styled(Title)`
  font-family: 'Julius Sans One', sans-serif;
  font-size: 3.5rem;
  text-align: left;
`

const ProfileDetail = styled.p`
  font-size: 0.9rem;
  letter-spacing: 3px;
  margin: 0;
  opacity: 0.6;
  margin-left: 5px;
`

const ExperinceWrapper = styled(FullScreen)`
  width: 30%;
  padding-left: 50px;
  padding-right: 50px;
  display: inline-block;
  vertical-align: top;
`

const ExperinceTime = styled.p`
  font-size: 0.8rem;
`

class Profile extends Component {
  render() {
    return (
      <React.Fragment>
        <ProfileWrapper>
          <ProfileContainer>
            <ProfileBorder />
            <ProfileTitle>Punn</ProfileTitle>
            <ProfileDetail>Punchaya Siriphanthong</ProfileDetail>
            <ProfileDetail>26 December 1996 | 22 years old</ProfileDetail>
            <ProfileDetail>p.siriphanthong@gmail.com</ProfileDetail>
          </ProfileContainer>
        </ProfileWrapper>
        <ExperinceWrapper>
          <Title>Education</Title>
          <p>Assumption Collect Ubonratchathani</p>
          <ExperinceTime>sldjfdskf</ExperinceTime>
          <p>King's Mongkut University</p>
          <Title>Experince</Title>
        </ExperinceWrapper>
      </React.Fragment>
    )
  }
}

export default Profile
